subSubSection.paragraph:
Gnathosoma

. Epistome with essentially smooth edge, some specimens with sparse denticles (
Fig. 11
). Hypostomal setae h1 41 (33–47), h2 28 (19–29), h3 70 (59–71), capitular seta 45 (46–49). Deutosternal groove parallel-sided, bearing six deutosternal rows with 8–13 denticles per row. Fringed internal malae aligned medially, with short lateral lobes. Tips of fimbriae have distinct swellings (
Fig. 14
). Corniculi 22 (20–22) long, and somewhat broad. Palp trochanter-tibia holotrichous (2:5:6:14). Palp genu al1 shorter than al2, both distally compressed. Four teeth on fixed digit, with one small tooth distal of uninflated pilus dentilis and three welldeveloped teeth proximal. Tip of fixed digit divided (
Figs 12
, 
21
). Cheliceral seta dorsal, 8 long. Movable digit 63 (59–63) with two well-developed teeth borne on antiaxial edge (
Fig. 16
). Second cheliceral segment 151–174, first segment 65–71. Labrum projects strongly to level of distal edge of palp femur.
